import React from "react";
import Ingredients from "../Ingredient/Ingredient";

export default function IngredientsList({ IngredientsObject }) {
  const IngredientElement = IngredientsObject.map((ingredient) => {
    return <Ingredients />;
  });
  return <div>{IngredientElement}</div>;
}
